import Head from "next/head";
import styled from "styled-components";
import Layout from "../components/Layout";
const Test = styled.div`
  color: red;
`;
const Index = () => (
  <div>
    <Head>
      <title>Index 페이지</title>
    </Head>
    <Layout>Hello inyong~!</Layout>
  </div>
);

export default Index;
